import React from "react";
import styled from "styled-components";
import { Button as B } from "./Main.elements";
const Container = styled.div`
  display: flex;
  background-color: var(--green);
  gap: ${({ gap }) => gap && gap + "rem"};
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;
const Row = styled.div`
  display: flex;
  gap: ${({ gap }) => gap && gap + "rem"};
  flex-direction: ${({ col }) => col && "column"};
  & > p {
    font-size: ${({ fsize }) => fsize && fsize + "px"};
    width: ${({ w }) => (w ? w + "%" : "fit-content")};
    text-align: center;
    color: ${({ color }) => color && color};
  }
`;
const Button = styled(B)``;
const getItSection = () => {
  return (
    <Container gap={2}>
      <Row w={80} color="white" fsize={25} col gap={1}>
        <p> Get it on Play Store and Download on App Store</p>
        <Row gap={3}>
          {" "}
          <Button google={true}>
            <Row>
              <img src="images/googlePlay.svg" alt="" />
            </Row>
            <Row col>
              <p>Get it on</p>
              <p>Play store</p>
            </Row>
          </Button>
          <Button>
            <Row>
              <img src="images/app.svg" alt="" />
            </Row>
            <Row col>
              <p>Get it on</p>
              <p>App store</p>
            </Row>
          </Button>
        </Row>
      </Row>
    </Container>
  );
};

export default getItSection;
